import React from 'react';


import '../style/winLoseDraw.css';
import Score from './Score';

const WinLoseDraw = (props) => {

    const score = '';

    if (props.WinLoseDraw === 1) {
        score = 'lose'
    }
    if (props.WinLoseDraw === 2) {
        score = 'win'
    }
    if (props.WinLoseDraw === 3) {
        score = 'draw'
    }

    console.log(score);

    return (
        <div className='wld' >

            {score}

        </div>
    )
}




export default WinLoseDraw;
